import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  return (
    <div className="navBar">
      <h1 className="navTitle">Book My Service</h1>
      <Link to="/find-freelancers" className="navLink">
        Find Freelancer
      </Link>
      <Link to="/find-jobs" className="navLink">
        Find Jobs
      </Link>
      <Link to="/how-it-works" className="navLink">
        How it Works
      </Link>
      <Link to="/about-us" className="navLink">
        About Us
      </Link>
      <Link to="/SignIn" className="loginButton">
        <span className="loginButtonText">Login</span>
      </Link>
    </div>
  );
};

export default Header;
